import React from "react";
import Table from 'react-bootstrap/Table';

export class Carros extends React.Component{
    constructor(props){
        super(props);

        this.state = {
            alunos: []
        }
    }

    render(){
        return (
            <Table striped bordered hover>
              <thead>
                <tr>
                  <th>#</th>
                  <th>Modelo</th>
                  <th>Ano</th>
                  <th>Propriet√°rio</th>
                  <th>Status</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>1</td>
                  <td>Mark</td>
                  <td>Otto</td>
                  <td>@mdo</td>
                </tr>
                <tr>
                  <td>2</td>
                  <td>Jacob</td>
                  <td>Thornton</td>
                  <td>@fat</td>
                </tr>
                <tr>
                  <td>3</td>
                  <td colSpan={2}>Larry the Bird</td>
                  <td>@twitter</td>
                </tr>
              </tbody>
            </Table>
          );
        }
}
